import React, { Component } from 'react';
import Layout from '../Layout'
import Table from '../components/Table';

class Dreans extends Component {
    constructor(props) {
        super(props);
        this.state = {
            tableItems: []
        }
    }

    getData = () => {
        fetch('/api/alldreans')
            .then(res => res.json())
            .then(res => {
                this.setState({ tableItems: res }, () => {
                    console.log('dreans init', this.state.tableItems);
                });
            })
    }



    componentWillMount() {
        console.log('did mount dreans')
        this.getData();
    }

    render() {
        console.log('render dreans')
        console.log('state table items',this.state.tableItems);

        return (
            <Layout>
                <Table data={this.state.tableItems} />
                <button onClick={this.getData}>Reload</button>
            </Layout>
        )
    }
}

export default Dreans;
